import React, { Fragment } from "react";
import Layout from "../components/layout";
import Head from "next/head";

const Index = () => {
  return (
    <Fragment>
      <Head>
        <title>:: Index ::</title>
      </Head>
      <Layout>
        <h1>Index page</h1>
      </Layout>
    </Fragment>
  );
};

export default Index;
